import React from 'react';
import './Header.css';
import headerLogo from '../../images/header-logo.svg';

function Header() {
  return (
    <div className='header'>
      <img className="header__logo" src={headerLogo} alt="Логотип" />
      <div className="header__user-films">

      </div>
    </div>
  )
}
export default Header;
